import React from "react";
import { Sidenav } from "rsuite";
import EmailRoundedIcon from "@material-ui/icons/EmailRounded";
import LinkedInIcon from "@material-ui/icons/LinkedIn";
import GitHubIcon from "@material-ui/icons/GitHub";
// import DescriptionRoundedIcon from '@mui/icons-material/DescriptionRounded';
import "../styles/navigation.css";
import "react-typist/dist/Typist.css"; 
import PopInSection from "./PopInSection.js"; 
import { LinkSharp } from "@material-ui/icons";

const userMobile = window.innerWidth < 600; 

class navigation extends React.Component {
    constructor() {
        super()
        this.state = {
            expanded: true, 
            activeKey: "1"
        };
        this.handleSelect = this.handleSelect.bind(this); 
    }
    handleSelect(eventKey) {
        this.setState({
            activeKey: eventKey
        });
    }
    render() {

        const allLinks = [
            <a href="#home">{"</home>"}</a>,
            <a href="#about">{"</about>"}</a>,
            <a href="#expo">{"</experience>"}</a>,
            <a href="#pp">{"</projects>"}</a>,
            <a href="#resume">{"</resume>"}</a>
        ];

        const {expanded} = this.state; 

        return (
            <div className="navigation">
                {!userMobile && (
                    <Sidenav
                    expanded={expanded}
                    defaultOpenKeys={["3", "4"]}
                    activeKey={this.state.activeKey}
                    onSelect={this.handleSelect}
                    appearance={"subtle"}>
                    <Sidenav.Body>
                        <div className="nav-links">
                            {allLinks.map((link, i) => (
                                <PopInSection delay={`${i + 1}00ms`}>
                                    <div>{link}</div>
                                </PopInSection>
                            ))}
                        </div>
                    </Sidenav.Body>
                </Sidenav>
                )}
                <PopInSection>
                <div className="nav-logos">
                    <a href="mailto:ethanpineda2025@u.northwestern.edu"><EmailRoundedIcon style={{ fontSize: 20}}></EmailRoundedIcon></a>
                    <a href="https://github.com/ethanpaneraa"><GitHubIcon style={{ fontSize: 19}}></GitHubIcon></a>
                    <a href="https://www.linkedin.com/in/ethanpineda/"><LinkedInIcon style={{ fontSize: 21 }}></LinkedInIcon></a>
                    <a href="/assets/Pineda_Ethan_Resume_2025.pdf"></a>
                </div>
                </PopInSection>
            </div>
        );

    }
}

export default navigation;
